import React, { useState } from "react";
import '../../css/SearchStyle.css';

// import { PieChart, Pie, Tooltip, Cell } from "recharts";

function App() {
  const [query, setQuery] = useState(""); // Search bar value
  const [results, setResults] = useState(null); // API results
  const [loading, setLoading] = useState(false); // Loading indicator
  const [error, setError] = useState(null); // Error handling

  const handleSearch = () => {
    setLoading(true);
    setError(null);

    // API call
    fetch(`https://localhost:7043/api/products?product=${query}`)
      .then((response) => {
        if (!response.ok) {
          throw new Error("API Error");
        }
        return response.json();
      })
      .then((data) => {
        setResults(data); // Set the entire Root object
        setLoading(false);
      })
      .catch((err) => {
        setError(err.message);
        setLoading(false);
      });
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h1>Product Search</h1>

      {/* Search Bar */}
      <input
        type="text"
        placeholder="Search for products..."
        value={query}
        onChange={(e) => setQuery(e.target.value)}
        style={{ padding: "10px", width: "300px", marginRight: "10px" }}
      />
      <button id="search" onClick={handleSearch} style={{ padding: "10px" }}>
        Search
      </button>

      {/* Loading Indicator */}
      {loading && <p>Loading...</p>}

      {/* Error Message */}
      {error && <p style={{ color: "red" }}>Error: {error}</p>}

      {/* Results */}
      {results && (
      

        <div class="table-container">
  <div className="table-container">
  {/* Header */}
  {/* <div className="table-header">
    <div>Image</div>
    <div>Name</div>
    <div>Gross Price</div>
    <div>Gross Unit Price</div>
  </div> */}

  {/* Rows */}
  {/* <ul className="styled-table">
    {results.map((item) => (
      <li key={item.id} className="table-row">
       
        <img 
      src={item.thumbnail}
      />
        <div>{item.name}</div>
        <div>{item.gross_price}</div>
        <div>{item.gross_unit_price}</div>
      </li>
    ))}
  </ul> */}






  
</div>



<table border="1" style="border-collapse: collapse; width: 100%;">
    <thead>
        <tr>
            <th>Image</th>
            <th>Name</th>
            <th>Gross Price</th>
            <th>Gross Unit Price</th>
        </tr>
    </thead>
    <tbody>
        <tr>
            <td><img src="path/to/image" alt="Pink Lady Epler"/></td>
            <td>Pink Lady Epler</td>
            <td>46.20</td>
            <td>54.35</td>
        </tr>
        <tr>
            <td><img src="path/to/image" alt="Epler, Grønne, 6 pk"/></td>
            <td>Epler, Grønne, 6 pk</td>
            <td>35.00</td>
            <td>38.89</td>
        </tr>
        <tr>
            <td><img src="path/to/image" alt="Epler Gravenstein"/></td>
            <td>Epler Gravenstein</td>
            <td>59.80</td>
            <td>29.90</td>
        </tr>
        <tr>
            <td><img src="path/to/image" alt="Eplejuice Premium"/></td>
            <td>Eplejuice Premium</td>
            <td>27.60</td>
            <td>27.60</td>
        </tr>
        <tr>
            <td><img src="path/to/image" alt="Epler Discovery / Aroma"/></td>
            <td>Epler Discovery / Aroma</td>
            <td>56.90</td>
            <td>37.93</td>
        </tr>
        <tr>
            <td><img src="path/to/image" alt="Røde Epler i Pose"/></td>
            <td>Røde Epler i Pose</td>
            <td>54.40</td>
            <td>27.20</td>
        </tr>
        <tr>
            <td><img src="path/to/image" alt="Orginal Eplejuice"/></td>
            <td>Orginal Eplejuice</td>
            <td>24.80</td>
            <td>24.80</td>
        </tr>
        <tr>
            <td><img src="path/to/image" alt="Epler gule, 4 pk"/></td>
            <td>Epler gule, 4 pk</td>
            <td>30.70</td>
            <td>40.93</td>
        </tr>
        <tr>
            <td><img src="path/to/image" alt="Epler, Røde, 6 pk"/></td>
            <td>Epler, Røde, 6 pk</td>
            <td>30.50</td>
            <td>33.89</td>
        </tr>
        <tr>
            <td><img src="path/to/image" alt="Epler, grønne, 4 pk"/></td>
            <td>Epler, grønne, 4 pk</td>
            <td>31.90</td>
            <td>45.57</td>
        </tr>
        <tr>
            <td><img src="path/to/image" alt="Eplejuice"/></td>
            <td>Eplejuice</td>
            <td>31.90</td>
            <td>21.27</td>
        </tr>
       
    </tbody>
</table>





</div>

      )}
    </div>
  );
}


export default App;
